import React from "react";
import { MDBCarousel, MDBCarouselInner, MDBContainer } from
"mdbreact";
import data from '../assets/json/data.js';
import CItem from './CItem.js';

class Carousel extends React.Component {

    constructor() {
        super();
        this.one = null;
        this.two = null;
        this.three = null;
        this.four = null;
    }

    createTable() {
        this.one = this.getRandomCity();
        this.two = this.getRandomCity();
        this.three = this.getRandomCity();
        this.four = this.getRandomCity();

        var list = [];
        list.push(<CItem key={0} itemId={0} title={this.one.name} src={this.one.image} />);
        list.push(<CItem key={1} itemId={1} title={this.two.name} src={this.two.image} />);
        list.push(<CItem key={2} itemId={2} title={this.three.name} src={this.three.image} />);
        list.push(<CItem key={3} itemId={3} title={this.four.name} src={this.four.image} />);

        return list;
    }

    getRandomCity() {
        var current = data[Math.floor(Math.random() * data.length)];
        if(!current.used) {
            current.used = true;
            return current;
        } else {
            current = data[Math.floor(Math.random() * data.length)];
            current.used = true;
            return current;
        }
    }

    render() {
        return (
            <MDBContainer className="carousel">
              <h4 className="mt-5 mb-2">Popular MYtineraries</h4>
              <MDBCarousel activeItem={1} length={4} showControls={true} showIndicators={true} className="z-depth-1">
                <MDBCarouselInner>
                <CItem key={3} itemId={3} title={this.four.name} src={this.four.image}></CItem>
                </MDBCarouselInner>
              </MDBCarousel>
            </MDBContainer>
          );
    }   
}

export default Carousel;
